sys_variable_value.value:
(function execute(inputs, outputs) {
    if (inputs.statusCode == '200') {
        var response = JSON.parse(inputs.responseBody);
        var rd = response.data[0];

        if (response.pagination.count > 0) {
            outputs.flight_status = rd.flight_status;
            outputs.delay = rd.departure.delay;
            outputs.departure_city = rd.departure.airport;
            outputs.departure_time = rd.departure.scheduled;
            outputs.terminal = rd.departure.terminal;
            outputs.arrival_city = rd.arrival.airport;
            outputs.arrival_time = rd.arrival.scheduled;
            outputs.gate = rd.arrival.gate;
            outputs.baggage = rd.arrival.baggage;
        } else {
            outputs.flight_status = '';
            outputs.delay = '';
            outputs.departure_city = '';
            outputs.departure_time = '';
            outputs.terminal = '';
            outputs.arrival_city = '';
            outputs.arrival_time = '';
            outputs.gate = '';
            outputs.baggage = '';
        }
    }
})(inputs, outputs);

